-- ----------------------------
-- Table structure for schedule_agent_type
-- ----------------------------
DROP TABLE IF EXISTS `schedule_agent_type`;
CREATE TABLE `schedule_agent_type`
(
    `id`                 int(11) NOT NULL AUTO_INCREMENT,
    `agent_type_name`    varchar(191) NOT NULL COMMENT 'agent类型名称',
    `handler`            varchar(191) DEFAULT NULL COMMENT '处理器',
    `can_be_scheduled`   tinyint(1) NOT NULL COMMENT '是否定时执行',
    `can_create_events`  tinyint(1) NOT NULL COMMENT '是否生成事件',
    `can_dry_run`        tinyint(1) NOT NULL COMMENT '是否空运行',
    `can_receive_events` tinyint(1) NOT NULL COMMENT '是否接收事件',
    `default_schedule`   int(11) DEFAULT NULL COMMENT '默认定时周期',
    `description_html`   mediumtext   DEFAULT NULL COMMENT '使用方法',
    `introduction`       mediumtext   DEFAULT NULL COMMENT '简介',
    `form_url`           varchar(191) NOT NULL COMMENT '表单地址',
    `options_template`   mediumtext   DEFAULT NULL COMMENT '配置模板',
    `options_schema`     mediumtext   DEFAULT NULL COMMENT '表单校验规则，如果配置是json类型',
    `created_at`         datetime     NOT NULL COMMENT '创建时间',
  `updated_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='agent定义信息';

