INSERT INTO `schedule_agent_type` VALUES ('1', '网页提取任务', 'cn.cxnxs.scheduler.core.agents.WebsiteAgent', '1', '1', '1', '1', '3', '<p class=\"ql-align-center\"><span class=\"ql-size-huge\">使用方法</span></p><p><strong><s>这是使用方法</s></strong></p><ol><li>哈哈哈哈</li><li>呵呵呵</li><li>嘻嘻嘻嘻嘻嘻嘻嘻嘻</li><li><span style=\"color: rgb(230, 0, 0);\">123456789</span></li></ol><p><a href=\"http://localhost:8080/scheduler/agent/agentType\" rel=\"noopener noreferrer\" target=\"_blank\">http://localhost:8080/scheduler/agent/agentType</a></p><p><img src=\"data:image/png;base64,\"></p>', '<ol><li><span style=\"background-color: rgb(255, 255, 0); color: rgb(153, 51, 255);\">哈哈哈哈</span></li><li><span style=\"background-color: rgb(255, 255, 0); color: rgb(153, 51, 255);\">呵呵呵</span></li><li><span style=\"background-color: rgb(255, 255, 0); color: rgb(153, 51, 255);\">嘻嘻嘻嘻嘻嘻嘻嘻嘻</span></li></ol>', 'scheduler/agent/agent-management/form/website.vue', '{\"url\":\"https://movie.douban.com/cinema/nowplaying/hangzhou/\",\"method\":\"get\",\"type\":\"html\",\"mode\":\"on_change\",\"uniqueness_look_back\":1,\"include_sort_info\":true,\"extract\":{\"title\":{\"css\":\"li[@data-category=\'nowplaying\']\",\"value\":\"@data-title\"}},\"headers\":{},\"data\":{},\"disable_ssl_verification\":false,\"events_order\":[]}', '{\"title\":\"options\",\"description\":\"网站抓取配置\",\"type\":\"object\",\"properties\":{\"url\":{\"title\":\"请求链接\",\"examples\":[\"www.baidu.com\"],\"type\":\"string\"},\"url_from_event\":{\"type\":\"string\"},\"method\":{\"title\":\"请求方式\",\"enum\":[\"get\",\"post\"],\"type\":\"string\",\"default\":\"get\"},\"type\":{\"title\":\"数据类型\",\"enum\":[\"html\",\"xml\",\"json\",\"text\"],\"type\":\"string\",\"default\":\"html\"},\"sslpv\":{\"title\":\"ssl版本\",\"enum\":[\"\",\"TLSv1\",\"TLSv1.1\",\"TLSv1.2\",\"SSLv3\"],\"type\":\"string\",\"default\":\"\"},\"include_sort_info\":{\"type\":\"boolean\",\"default\":false},\"disable_ssl_verification\":{\"type\":\"boolean\",\"default\":false},\"uniqueness_look_back\":{\"type\":\"integer\",\"minimum\":1},\"expected_update_period_in_days\":{\"type\":\"integer\",\"minimum\":1},\"headers\":{\"title\":\"请求头信息\",\"type\":\"object\"},\"extract\":{\"title\":\"数据获取规则配置\",\"type\":\"object\"},\"template\":{\"type\":\"object\"},\"events_order\":{\"type\":\"array\"},\"data\":{\"title\":\"请求数据\",\"type\":\"object\"}},\"required\":[\"uniqueness_look_back\",\"expected_update_period_in_days\",\"url\",\"extract\",\"type\",\"method\"]}', '2024-02-06 16:00:02', '2024-02-07 10:27:21');
