-- Table structure for sys_menu
-- ----------------------------
DROP TABLE IF EXISTS `sys_menu`;
CREATE TABLE `sys_menu`
(
    `id`          int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键id',
    `parent_id`   int(11) DEFAULT NULL COMMENT '父id',
    `client_id`   varchar(256) DEFAULT NULL COMMENT '所属应用',
    `menu_name`   varchar(100) DEFAULT NULL COMMENT '菜单标题',
    `url`         varchar(255) DEFAULT NULL COMMENT '路径',
    `sort_no`     int(10) DEFAULT NULL COMMENT '菜单排序',
    `icon`        varchar(128) DEFAULT '' COMMENT '菜单图标',
    `icon_svg`    varchar(128) DEFAULT NULL,
    `description` varchar(255) DEFAULT NULL COMMENT '描述',
    `state`       int(11) DEFAULT NULL COMMENT '权限状态(0无效1有效)',
    `auth`        int(11) DEFAULT NULL COMMENT '是否鉴权，0-是，1-否',
    `hide`        int(11) DEFAULT NULL COMMENT '是否隐藏：0-是，1-否',
    `cache`       int(11) DEFAULT NULL COMMENT '是否缓存，0-是，1-否',
    `component`   varchar(128) DEFAULT NULL COMMENT '组件地址',
    `redirect`    varchar(128) DEFAULT '' COMMENT '重定向地址',
    `route_name`  varchar(128) DEFAULT NULL COMMENT '路由名称',
    `permission`  varchar(128) DEFAULT NULL COMMENT '权限标识',
    `badge_url`   varchar(191) DEFAULT NULL COMMENT '菜单右上角标记地址',
    `created_at`  bigint(20) DEFAULT NULL COMMENT '创建时间',
    PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=39 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci COMMENT='菜单表';

