    `state`           int(11) NOT NULL COMMENT '状态：0启用，1禁用',
    `description`     varchar(255) NOT NULL DEFAULT '' COMMENT '接口描述',
    `created_at`      bigint(20) NOT NULL COMMENT '创建时间',
    `update_at`       bigint(20) DEFAULT NULL COMMENT '更新时间',
    PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='权限表';

